package br.edu.faculdade.clash_of_clans_app.config;

import br.edu.faculdade.clash_of_clans_app.entity.CartaEntity;
import br.edu.faculdade.clash_of_clans_app.repository.CartaRepository;
import io.micrometer.common.util.internal.logging.InternalLogger;
import lombok.RequiredArgsConstructor;
import lombok.extern.slf4j.Slf4j;
import org.springframework.boot.CommandLineRunner;
import org.springframework.stereotype.Component;

import java.math.BigDecimal;
import java.util.Arrays;
import java.util.List;

@Component
@RequiredArgsConstructor
@Slf4j
public class DataInitializer implements CommandLineRunner {

    private final CartaRepository cartaRepository;

    public DataInitializer(CartaRepository cartaRepository) {
        this.cartaRepository = cartaRepository;
    }

    @Override
    public void run(String... args) throws Exception {
        // Verifica se já existem cartas no banco
        InternalLogger log = null;
        if (cartaRepository.count() > 0) {
            log.info("Banco de dados já contém cartas. Pulando inicialização.");
            return;
        }

        log.info("Inicializando banco de dados com cartas padrão do Clash Royale...");

        List<CartaEntity> cartasIniciais = Arrays.asList(
            // Tropas Terrestres
            criarCarta("Cavaleiro", 240, new BigDecimal("1.2"), 60, false, "data:image/jpeg;base64,"),
            criarCarta("Gigante", 570, new BigDecimal("1.5"), 25, false, "data:image/jpeg;base64,"),
            criarCarta("Mini P.E.K.K.A", 598, new BigDecimal("1.8"), 55, false, "data:image/jpeg;base64,"),
            criarCarta("P.E.K.K.A", 816, new BigDecimal("1.8"), 45, false, "data:image/jpeg;base64,"),
            criarCarta("Príncipe", 325, new BigDecimal("1.5"), 70, false, "data:image/jpeg;base64,"),
            criarCarta("Príncipe das Trevas", 280, new BigDecimal("1.3"), 65, true, "data:image/jpeg;base64,"),
            criarCarta("Golem", 350, new BigDecimal("2.5"), 20, false, "data:image/jpeg;base64,"),
            criarCarta("Lava Hound", 45, new BigDecimal("1.3"), 35, false, "data:image/jpeg;base64,"),
            
            // Tropas Rápidas
            criarCarta("Duendes", 91, new BigDecimal("1.1"), 90, false, "data:image/jpeg;base64,"),
            criarCarta("Duendes com Lança", 90, new BigDecimal("1.3"), 70, false, "data:image/jpeg;base64,"),
            criarCarta("Horda de Servos", 67, new BigDecimal("1.0"), 85, false, "data:image/jpeg;base64,"),
            criarCarta("Bárbaro de Elite", 285, new BigDecimal("1.5"), 75, false, "data:image/jpeg;base64,"),
            criarCarta("Megacavaleiro", 240, new BigDecimal("1.5"), 60, true, "data:image/jpeg;base64,"),
            
            // Tropas Aéreas
            criarCarta("Servos", 67, new BigDecimal("1.0"), 85, false, "data:image/jpeg;base64,"),
            criarCarta("Bebê Dragão", 113, new BigDecimal("1.6"), 60, true, "data:image/jpeg;base64,"),
            criarCarta("Balão", 600, new BigDecimal("3.0"), 30, false, "data:image/jpeg;base64,"),
            criarCarta("Bruxa", 84, new BigDecimal("0.7"), 55, true, "data:image/jpeg;base64,"),
            
            // Feitiços (velocidade de ataque instantânea = 0.1)
            criarCarta("Flechas", 144, new BigDecimal("0.1"), 0, true, "data:image/jpeg;base64,"),
            criarCarta("Bola de Fogo", 325, new BigDecimal("0.1"), 0, true, "data:image/jpeg;base64,"),
            criarCarta("Raio", 394, new BigDecimal("0.1"), 0, true, "data:image/jpeg;base64,"),
            criarCarta("Foguete", 493, new BigDecimal("0.1"), 0, true, "data:image/jpeg;base64,"),
            criarCarta("Zap", 159, new BigDecimal("0.1"), 0, true, "data:image/jpeg;base64,"),
            criarCarta("Tornado", 20, new BigDecimal("0.1"), 0, true, "data:image/jpeg;base64,"),
            criarCarta("Veneno", 85, new BigDecimal("1.0"), 0, true, "data:image/jpeg;base64,"),
            
            // Construções
            criarCarta("Torre de Bombas", 95, new BigDecimal("1.6"), 0, true, "data:image/jpeg;base64,"),
            criarCarta("Torre Inferno", 51, new BigDecimal("0.4"), 0, false, "data:image/jpeg;base64,"),
            criarCarta("Torre Tesla", 109, new BigDecimal("1.0"), 0, false, "data:image/jpeg;base64,"),
            criarCarta("Canhão", 91, new BigDecimal("0.8"), 0, false, "data:image/jpeg;base64,"),
            criarCarta("Cabana de Goblins", 50, new BigDecimal("1.0"), 0, false, "data:image/jpeg;base64,"),
            
            // Cartas Especiais
            criarCarta("Mago", 130, new BigDecimal("1.7"), 50, true, "data:image/jpeg;base64,"),
            criarCarta("Valquíria", 123, new BigDecimal("1.5"), 60, true, "data:image/jpeg;base64,"),
            criarCarta("Esqueletos", 67, new BigDecimal("1.0"), 90, false, "data:image/jpeg;base64,"),
            criarCarta("Arqueiras", 79, new BigDecimal("1.2"), 60, false, "data:image/jpeg;base64,"),
            criarCarta("Mosqueteira", 100, new BigDecimal("1.0"), 55, false, "data:image/jpeg;base64,"),
            criarCarta("Bandida", 156, new BigDecimal("1.1"), 80, false, "data:image/jpeg;base64,")

        );

        cartaRepository.saveAll(cartasIniciais);
        
        log.info("✅ {} cartas do Clash Royale foram adicionadas ao banco de dados!", cartasIniciais.size());
    }

    private CartaEntity criarCarta(String nome, Integer dano, BigDecimal velocidadeAtaque, 
                                    Integer velocidadeArena, Boolean indicadorDadoArea, String imagemUrl) {
        CartaEntity carta = new CartaEntity();
        carta.setNome(nome);
        carta.setDano(BigDecimal.valueOf(dano));
        carta.setDano(velocidadeAtaque);
        carta.setVelocidadeArena(velocidadeArena);
        carta.setIndicadorDadoArea(indicadorDadoArea);
        carta.setImagemUrl(imagemUrl);
        return carta;
    }
}
